            const stock_data: graph_data[] = [
                {
                    stock: key,
                    positive: value[0],
                    positiveColor: "hsl(288, 70%, 50%)",
                    negative: value[1],
                    negativeColor: "hsl(2, 70%, 50%))",
                    mixed: value[2],
                    mixedColor: "hsl(323, 70%, 50%)",
                }
            ];


            final_data.push(stock_data[0])
        });
        console.log(final_data)
        return(final_data);
    }

